import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import classes from "./Footer.module.scss";

const footer = () => {
	return (
		<footer className={classes.Footer}>
			<Container>
				<Row>
					<Col sm={4}>as</Col>
					<Col sm={{ span: 7, offset: 1 }}>footer</Col>
				</Row>
			</Container>
		</footer>
	);
};

export default footer;
